import React from 'react'
const Blog = ({ blog }) => {
  const blogStyle = {
    paddingTop: 10,
    paddingLeft: 2,
    border: 'solid',
    borderWidth: 1,
    marginBottom: 5
  }

  return (
    <div style={blogStyle}>
      <i>Title: </i> {blog.title} <i>Author: </i>{blog.author} <i>Url: </i>{blog.url}
    </div>
  )
}

export default Blog
